import React  from 'react'
import {Link} from 'react-router-dom' // adding Link
import mainArray from './myArray'
//import marray from './myArray'

function MainPage(props) {
    
    return(
        <div className='head'>
            <h1> My To Do List</h1>
            {props.mainArray.map((items,index) => {
            return <Link className='createSpace' to ={items.link}>{items.path}</Link>    
            })}
            {/* <Link className='createSpace' to ='/addToDoList'>Add To Do List</Link>
            <Link className='createSpace' to ='/searchToDoList'>Search To Do List</Link> */}
        </div>
    )
    
}

export default MainPage
